 *  评论列表完成回调
 *
 *  支持平台：书旗Android、书旗iOS
 *
 *  @return 0：传入参数解析失败 1：传入参数解析成功
 *
 *  @example
 * libSQ.exec('call-app-comment-list-finish', { params: {
 *   bookId: '7506930',
 *   bookName: '桃色小神医',
 *   authorId: '902492',
 *   authorName: '地心引力',
 *   topClass: '402',
 *   imgUrl: 'http://img-tailor.11222.cn/bcv/big/201805161004213888.jpg',
 * }}).then((info) => {
 *   console.log(`[call-app-comment-list-finish][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[call-app-comment-list-finish][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

